An intense thriller in the riveting style of SEVEN from the director of DARKNESS! Five years after her daughter was brutally murdered, Claudia remains mired in despair and can't move on with her life. Then she receives a phone call from a young woman claiming to be that daughter, Angela, asking for help and stating that a nameless &quot;they&quot; only wanted Claudia to think she was dead! With skeptical authorities unwilling to help, it's up to Claudia herself to investigate the shadowy subculture of danger and secrecy that holds the answer to Angela's true fate! Lauded with numerous international movie awards including Best International Film at the Fant-Asia Film Festival, THE NAMELESS will put you on the edge of your seat as the mystery deepens all the way through its pulse-pounding conclusion!

Los Sin Nombre is a twisted and dark horror film about a woman who's life is shattered when her young daughter disappears one night. A few days later, her body is found and this simply destroyes the family. Years later, the woman is on her own trying to rebuild her shattered personnal life. But one night after a rough day in the office, she recieves a call that sends a chill down her sign and brings back painful memories. Who or what was this phone call about? To find out you'll have to watch NAMELESS a.k.a. LOS SIN NOMBRE.

Language: Spanish
Subtitles: English Hard Coded

